import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar =() => {
    return (
        <div className="navbar">
        
    <Link to="/">Home</Link>
    <Link to="/">Order</Link>
    <Link to="/">Leader</Link>
    <Link to="/">Home</Link>
    <Link to="/">Home</Link>

        </div>
    )
}
export default NavBar;
